        mHdltvoutHandle << " , " <<  " \"dense_3_output_array_address0\" :  \"" << dense_3_output_array_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dense_3_output_array_ce0\" :  \"" << dense_3_output_array_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dense_3_output_array_we0\" :  \"" << dense_3_output_array_we0.read() << "\" ";
